@: q8-q11	AND buffer
@: q12-q15	64 byte accumulator		
@: q4-q11	reload and rearrangement	
		
ldpc_reformat_n35:
	push	{r0-r12,r14}
	
	ldr		r0,=ldpc_inter_array					@: input pointer
