	vshl.u8		q4,#1
	vshl.u8		q5,#1
	vshl.u8		q6,#1
	vshl.u8		q7,#1

	pop			{r0}								@: restore and resave the input pointer
	push		{r0}
	
@: load a byte from 45 rows of the inter array into q4-q7

	vld1.u8		d8[0],[r0]
	add			r0,#LBPR
	vld1.u8		d9[0],[r0]
	add			r0,#LBPR
	vld1.u8		d10[0],[r0]
	add			r0,#LBPR
