	vld1.u8		d12[3],[r0]
	add			r0,#LBPR
	vld1.u8		d13[3],[r0]
	add			r0,#LBPR
	vld1.u8		d14[3],[r0]
	add			r0,#LBPR
	vld1.u8		d15[3],[r0]
	add			r0,#LBPR

	vld1.u8		d8[4],[r0]
	add			r0,#LBPR
	vld1.u8		d9[4],[r0]
