	vsra.u8		q2L,q9L,#2
	vsra.u8		q2H,q9H,#3
	vsra.u8		q2L,q10L,#4
	vsra.u8		q2H,q10H,#5
	vsra.u8		q2L,q11L,#6
	vsra.u8		q2H,q11H,#7
