@:	Calling:
@:		r12 points to the stream structure
@:
@:	All registers are restored to their original values
@:
@:@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@
