	vmov.u8		q15,#0							@: accumulator	
	
@: do bytes 0, 15, 30, 45, 60, 75, 90, 105

	vmov.u8		q1,#0x80						@: AND mask for bits 7
	vmov.u8		q15,#0							@: accumulator
	
	vand		q2,q4,q1
	vand		q3,q5,q1	

