	vorr		q14,q7					@: q14 = qout [6]

@: bit 0: 16 bytes: 7, 15, . . . 127: bits 7-4

	vmov.u32	q7,#0					@: accumulator
	vmov.u8		q5,#0x01				@: mask	
	vmov.u32	q4,#128					@: multiplier

