	vand.u8		q6,q2,q5				@: mask off the bits of interest		
	vmla.u32	q7,q6,q4				@: accumulate

	vshr.u32	q4,#1					@: multiplier = 16,16,16,16

	vand.u8		q6,q3,q5				@: mask off the bits of interest		
	vmla.u32	q7,q6,q4				@: accumulate

	vshr.u8		q7,#4
